import React, { useState, useEffect } from 'react';
import {
  Box,
  Grid,
  Card,
  CardContent,
  Typography,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  Chip,
} from '@mui/material';
import axios from 'axios';

const availableTools = [
  'EmailTool',
  'InvoiceTool',
  'PaymentProcessor',
  'CalendarTool',
  'CustomerServiceTool',
  'DocumentGenerator',
];

function Dashboard() {
  const [agents, setAgents] = useState([]);
  const [open, setOpen] = useState(false);
  const [newAgent, setNewAgent] = useState({
    name: '',
    description: '',
    tools: [],
    instructions: '',
  });

  useEffect(() => {
    fetchAgents();
  }, []);

  const fetchAgents = async () => {
    try {
      const response = await axios.get('http://localhost:8000/agents');
      setAgents(response.data);
    } catch (error) {
      console.error('Error fetching agents:', error);
    }
  };

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleToolChange = (event) => {
    setNewAgent({
      ...newAgent,
      tools: event.target.value,
    });
  };

  const handleSubmit = async () => {
    try {
      await axios.post('http://localhost:8000/agents', newAgent);
      handleClose();
      fetchAgents();
      setNewAgent({
        name: '',
        description: '',
        tools: [],
        instructions: '',
      });
    } catch (error) {
      console.error('Error creating agent:', error);
    }
  };

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
        <Typography variant="h4">AI Agents Dashboard</Typography>
        <Button variant="contained" color="primary" onClick={handleOpen}>
          Create New Agent
        </Button>
      </Box>

      <Grid container spacing={3}>
        {agents.map((agent) => (
          <Grid item xs={12} md={6} lg={4} key={agent.name}>
            <Card>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  {agent.name}
                </Typography>
                <Typography color="textSecondary" paragraph>
                  {agent.description}
                </Typography>
                <Box sx={{ mt: 2 }}>
                  <Typography variant="subtitle2">Tools:</Typography>
                  <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                    {agent.tools.map((tool) => (
                      <Chip key={tool} label={tool} size="small" />
                    ))}
                  </Box>
                </Box>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Dialog open={open} onClose={handleClose} maxWidth="md" fullWidth>
        <DialogTitle>Create New Agent</DialogTitle>
        <DialogContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, mt: 2 }}>
            <TextField
              label="Agent Name"
              value={newAgent.name}
              onChange={(e) => setNewAgent({ ...newAgent, name: e.target.value })}
              fullWidth
            />
            <TextField
              label="Description"
              value={newAgent.description}
              onChange={(e) => setNewAgent({ ...newAgent, description: e.target.value })}
              fullWidth
              multiline
              rows={2}
            />
            <FormControl fullWidth>
              <InputLabel>Tools</InputLabel>
              <Select
                multiple
                value={newAgent.tools}
                onChange={handleToolChange}
                renderValue={(selected) => (
                  <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
                    {selected.map((value) => (
                      <Chip key={value} label={value} />
                    ))}
                  </Box>
                )}
              >
                {availableTools.map((tool) => (
                  <MenuItem key={tool} value={tool}>
                    {tool}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            <TextField
              label="Instructions"
              value={newAgent.instructions}
              onChange={(e) => setNewAgent({ ...newAgent, instructions: e.target.value })}
              fullWidth
              multiline
              rows={4}
            />
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained" color="primary">
            Create
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default Dashboard;
